import React from 'react';

const Users = () => {
    const users = [
      { name: 'Robin' },
      { name: 'Markus' },
    ];
    const showUsers = false;
    if (!showUsers) {
      return null;
    }
    return (
      <ul>
        {users.map(user => <li>{user.name}</li>)}
      </ul>
    );
  };
  export default Users;
